import carpenter_image from '../assets/service_images/carpenter_image.jpg';
import plumber_image from '../assets/service_images/plumber_image.jpg';
import electrician_image from '../assets/service_images/electrician_image.jpg';
import painter_image from '../assets/service_images/painter_image.jpg';
import cleaner_image from '../assets/service_images/cleaner_image.jpg';
import defaultImg from '../assets/service_images/default.jpg';

const images = {
    carpenter_image,
    plumber_image,
    electrician,
    painter,
    cleaner,
    default: defaultImg
};

export default images;
